import React from 'react';

const stats = [
  { label: 'Total payroll', value: '$48,200' },
  { label: 'Employees', value: '26' },
  { label: 'Bonuses applied', value: '$4,900' },
  { label: 'Tax total', value: '$6,340' }
];

const bars = [
  { month: 'Jan', value: 44 },
  { month: 'Feb', value: 52 },
  { month: 'Mar', value: 48 },
  { month: 'Apr', value: 60 },
  { month: 'May', value: 55 },
  { month: 'Jun', value: 66 }
];

const Dashboard = () => {
  return (
    <div className="page">
      <div className="page-header">
        <div>
          <h2>Payroll dashboard</h2>
          <p className="muted">Track company payroll performance at a glance.</p>
        </div>
        <button className="btn ghost">Download summary</button>
      </div>

      <div className="stat-grid">
        {stats.map((stat) => (
          <div key={stat.label} className="card stat-card">
            <span className="muted">{stat.label}</span>
            <strong>{stat.value}</strong>
          </div>
        ))}
      </div>

      <div className="card chart-card">
        <div className="chart-header">
          <h3>Payroll trend</h3>
          <span className="muted">Last 6 months</span>
        </div>
        <div className="chart">
          {bars.map((bar) => (
            <div key={bar.month} className="chart-bar">
              <div className="chart-fill" style={{ height: `${bar.value}%` }} />
              <span>{bar.month}</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
